// motion-impossible-frontend/src/App.js
import React from 'react';
import Timeline from './components/Timeline';
import './App.css';  // If you don't use styled-components for styling

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Motion Impossible</h1>
      </header>
      <main>
        <Timeline />
      </main>
    </div>
  );
}

export default App;
